-- Name: audit_soft_delete(); Type: FUNCTION; Schema: public; Owner: freshplan
--

CREATE FUNCTION public.audit_soft_delete() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- When a record is soft-deleted
    IF NEW.deleted_at IS NOT NULL AND OLD.deleted_at IS NULL THEN
            entity_type,
            entity_id,
            action,
            performed_by,
            performed_at,
            old_value,
            new_value
        ) VALUES (
            'Contact',
            NEW.id::VARCHAR,
            'SOFT_DELETE',
            NEW.deleted_by,
            NEW.deleted_at,
            jsonb_build_object('active', true),
            jsonb_build_object('active', false, 'reason', NEW.deletion_reason)
        );
    END IF;
    
    -- When a record is reactivated
    IF NEW.deleted_at IS NULL AND OLD.deleted_at IS NOT NULL THEN
            entity_type,
            entity_id,
            action,
            performed_by,
            performed_at,
            old_value,
            new_value
        ) VALUES (
            'Contact',
            NEW.id::VARCHAR,
            'REACTIVATE',
            NEW.reactivated_by,
            NEW.reactivated_at,
            jsonb_build_object('active', false),
            jsonb_build_object('active', true, 'reason', NEW.reactivation_reason)
        );
    END IF;
    
    RETURN NEW;
END;
$$;


