--
-- Name: calculate_helpfulness_rate(uuid); Type: FUNCTION; Schema: public; Owner: freshplan
--

CREATE FUNCTION public.calculate_helpfulness_rate(content_id uuid) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    helpful_count BIGINT;
    total_count BIGINT;
BEGIN
    SELECT h.helpful_count, (h.helpful_count + h.not_helpful_count)
    INTO helpful_count, total_count
    FROM help_contents h
    WHERE h.id = content_id;
    
    IF total_count = 0 THEN
        RETURN 0.0;
    END IF;
    
    RETURN ROUND((helpful_count::DECIMAL / total_count) * 100, 2);
END;
$$;


